window.bookSummaryJSON = "<p>An attitude? Why not? After all, what would you do if you were abducted by aliens and transported into a strange new universe away from your home, your family - everything familiar to you? Would it make you happy? Not likely!&nbsp;&nbsp;</p> <p>Now imagine you're stronger, faster, and more coordinated than every alien species you encounter. Would you start kicking some ass? Of course you would!&nbsp;&nbsp;&nbsp;</p> <p>This is the story of human superiority in the galaxy, a gritty, realistic profile of a young Navy SEAL who doesn't like aliens very much - and he makes them pay for the bad mood he's in.</p>"; 
